import React from "react";
import jsPDF from "jspdf";
import ResumeData from "../ResumeData";
import GenPDF from "./GenPDF";
const Resume = () => {
  return (
    <a
      target="_blank"
      href={ResumeData.map((val, index) => {
        return (
          <div>
            key={index}, doc={val.doc}
          </div>
        );
      })}
    />
  );
};

